import React, { Component } from 'react';
import NavBar from '../components/NavBar';
import 'bulma/css/bulma.css';
import WebFont from 'webfontloader'

WebFont.load({
    google: {
        families: ['Karla']
    }
});

const styles = {
    background: {
        position: 'absolute',
        justifyContent: 'center'
    },
    title: {
        fontFamily: 'Karla',
        fontSize: '50px',
        fontWeight: 'bold',
        position: 'relative',
        color: 'white',
        bottom: '50%',
        left: '15%'

    }
}

class HomePage extends Component {
    render() {
        return (
        <React.Fragment>
            <div><NavBar/></div>
            <img src={ process.env.PUBLIC_URL + '/main-background2.jpg'} style={ styles.background }/>
            <div style={ styles.title }>Hello World</div>

        </React.Fragment>
        );
    }
}

export default HomePage;
